import React from 'react';
import './Home.css';

function Home() {
  return (
    <div className="app-container">
      <header className="header">
        <h1>Chapitre 1</h1>
        <p>Apprendre l'alphabet</p>
        <img src="/./HomeAssets/book.png" alt="Locked" className="icon" />
        <div className="book"></div>
      </header>
      <main className="main-content">
        <div className="step start">
          <button className="start-button">START</button>
        </div>
        <div className="step locked"></div>
        <div className="step treasure"></div>
        <div className="step locked"></div>
        <div className="step reward"></div>
      </main>
    </div>
  );
}

export default Home;
